import App from "@/App";
import Dashboard from "@/features/dashboard/components/Dashboard";

export const protectedRoutes = [
    {
        path: '/app',
        element: <App />,
        children: [
            { path: '/discussions/*', element: <Dashboard /> }
        ],
    },
];
